import React from 'react';
import { FormMultiSelect } from 'components';
import { withKnobs, text } from '@storybook/addon-knobs';

export default {
  title: 'FormMultiSelect',
  component: FormMultiSelect,
  decorators: [withKnobs],
};

export const Default = () => {
  const selectedOptions = [
    { id: 0, label: 'Lorem Ipsum 1', value: 0 },
    { id: 1, label: 'Lorem Ipsum 2', value: 1 },
  ];

  const options = [
    { id: 0, label: 'Lorem Ipsum 1', value: 0 },
    { id: 1, label: 'Lorem Ipsum 2', value: 1 },
    { id: 2, label: 'Lorem Ipsum 3', value: 2 },
    { id: 3, label: 'Lorem Ipsum 4', value: 3 },
    { id: 4, label: 'Lorem Ipsum 5', value: 4 },
  ];

  return (
    <FormMultiSelect
      label={text('Text', '')}
      placeholder={text('Placeholder', '')}
      tagType="quantity"
      options={options}
      setSelectOption={(value) => {
        console.log(value);
      }}
      selectedOptions={selectedOptions}
    />
  );
};
